import React from 'react'
import {Menu} from 'antd'
import { connect } from 'react-redux'
import {Link} from "react-router-dom"

const PrivateNavItem = ({hasPermission, key, icon,  children}) => {
    return (

            hasPermission ?  
            <Menu.Item key={key}
                    icon={icon}>
                    <Link to={key}>{children}</Link>
            </Menu.Item>: 
            null
    )
}


const mapStateToProps = (ref) => {
    return {
        hasPermission: ref.firebase.isAuthenticated
    }
}

export default connect(mapStateToProps, {})(PrivateNavItem)
